import s from "./Song.module.scss";

const Song = ({ data }) => {
  return (
    <>
      <div className={s.songInfo}>
        <img src={data.album.cover}/>
        <div>
          <div>{data.title}</div>
          <div>{data.artist.name}</div>
        </div>
      </div>
    </>
  );
};
export default Song;
